type pie_data = {
    stock: string
    label: string
    value: number
    color: string
}

//Data [ticker, mentions]
const visualizationPieChart = (data: any[]) => {
    const final_data: any[] = []

    for (let i = 0; i < data.length; i++) {
        const pie_object: pie_data[] = [
            {
                stock: data[0],
                label: data[0],
                value: data[1],
                color: "hsl(249, 70%, 50%)"
            }
        ]

        final_data.push(pie_object[0]);
    }

    return final_data;

}

export default visualizationPieChart;
